INSERT INTO `articles` (`id`, `user_id`, `title`, `content`, `created_at`, `updated_at`) VALUES
(52, 3, 'How to Resolve HR Sprout Not Loading and Timeout Issues', '<p><img src=\"data:image/png;base64,\"></p><p><br></p><p><strong>Note:</strong> This article provides steps to troubleshoot and resolve issues with HR Sprout not loading and encountering timeouts during login.</p><p>Ensure you have a stable internet connection. This guide applies to users accessing HR Sprout.</p><p><br></p><p><strong>Instructions:</strong></p><p><strong>Step 1: Check Internet Connectivity</strong></p><ol><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Ensure your device is connected to a stable and reliable internet connection.</li><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Verify if other websites or applications are accessible without issues.</li></ol><p><br></p><p><strong>Step 2: Clear Browser Cache and Cookies</strong></p><ol><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Open your web browser\'s settings.</li><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Clear cache and cookies stored for HR Sprout or the web application.</li></ol><p><br></p><p><strong>Step 3: Verify System Requirements</strong></p><ol><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Ensure your device meets the minimum system requirements for accessing HR Sprout.</li><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Check if there are any browser or system updates needed.</li></ol><p><br></p><p><strong>Step 4: Check HR Sprout Service Status</strong></p><ol><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Visit the official HR Sprout <u>status page</u> or contact support to check if there are any ongoing service disruptions or maintenance.</li></ol><p><br></p><p><strong>Step 5: Restart Device and Retry</strong></p><ol><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Restart your computer or mobile device.</li><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Attempt to access HR Sprout again after rebooting.</li></ol><p><br></p><p><strong>Outcome:</strong> After following these steps, you should be able to access HR Sprout without encountering timeout errors, ensuring uninterrupted</p><p>login and functionality.</p>', '2024-07-18 02:29:34', '2024-08-15 08:04:08');
INSERT INTO `articles` (`id`, `user_id`, `title`, `content`, `created_at`, `updated_at`) VALUES
(56, 6, 'How to File and Know Ticket Updates in adish HAP', '<p class=\"ql-align-justify\"><strong style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">Note:</strong><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\"> This article provides steps to the filing ticket system and updates of each tickets in adish HAP Website. Ensure you have a stable internet connection in accessing the website. </span></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><strong style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">Instructions:</strong></p><p class=\"ql-align-justify\"><strong style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">Step 1: Go to File Ticket Page </strong></p><ol><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">Make sure to fill up the required information such as the department and employee to assigned the ticket to, title of the ticket and the description. </span></li><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Attachments are not required but it helps to fully understand the issue.</li></ol><p class=\"ql-align-justify\"><img src=\"data:image/png;base64,\"></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><strong style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">Step 2: Click File Button</strong></p><ol><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">After clicking the button, email notifications will be received. If you are the creator of the ticket, you will receive an email entitled as \"Ticket Creation\". If you are the assignee on the ticket, you will receive an email entitled as \"Ticket Assignment\".</span></li></ol><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><strong style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">Step 3: Check Email Notifications from Time to Time</strong></p><ol><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">Updates will be reflected on the email and on the website. Check it from time to time for assignments and updates of ticket. </span></li></ol><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><strong style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">Step 4: Use Discussion</strong></p><ol><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">For any other concerns in relation to the ticket, you may opt to use the discussion section of the page to add your comments and insights regarding the ticket flow and issue.</span></li></ol><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><strong style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">Step 5: Read Knowledge Base </strong></p><ol><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">Knowledge-base articles might already have the solution for the ticket that you might be filing. You can read these articles and they might be able to help you with the issue :) </span></li></ol><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><strong style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">Outcome:</strong><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\"> After following these steps, you should be able to know how to fully access the website and maximize its functionality, as well.</span></p>', '2024-08-05 07:52:44', '2024-08-19 03:42:43');

